import React from 'react'
import Post from '../../components/Post'

const DetailButton = props => {

    const showDetail = (id) => {
        return (<Post id={id} />)
    }

    return (
        <button 
            className="btn btn-secondary float-right"
            onClick={showDetail(props.id)}
        >
        Detalle
        </button>
    )
}

export default DetailButton
